e\';\n    document.getElementById(\"updateNubuilderProgress\").innerHTML=contents;\n    document.getElementById(\"updateNubuilderMessageDetails\").innerHTML=\'Please wait...\';\n}\nfunction switchProgressToButton() {\n    var contents = \'\';\n    document.getElementById(\"updateNubuilderProgress\").innerHTML=contents;\n    document.getElementById(\"updateNubuilderMessageDetails\").innerHTML=contents;\n    document.getElementById(\"Runbtn\").style.display = \'block\';\n}\n\nfunction displayUpdaterServerError() {\n    switchProgressToButton();\n    document.getElementById(\"updateNubuilderMessageDetails\").innerHTML=\'Update failed, internal server error!\';\n}\n\nfunction displayUpdaterResponse(JsonText) {\n    switchProgressToButton();\n\n    //var contents = \'<textarea rows=\"20\" cols=\"145\">\'+JsonText+\'</textarea>\';\n    //document.getElementById(\"updateNubuilderResponse\").innerHTML=contents;\n\n    obj = $.parseJSON(JsonText);\n    var result = \'<br><b>Result</b>: \' + obj.message + \'<br><br>\';\n    document.getElementById(\"updateNubuilderProgress\").innerHTML=result;\n\n    if ( obj.message == \'ERRORS\' ) {\n        displayMessageDetails(obj.errors, obj.dbupdate);\n    }\n    if ( obj.message == \'SUCCESS\' ) {\n        displayMessageDetails(obj.success, obj.dbupdate);\n    }\n  \n}\n\nfunction displayMessageDetails(message, dbupdate) {\n\n    var contents = \'<br><br><textarea rows=\"20\" cols=\"145\">\'; \n    contents = loopContents(contents, message);\n    contents = loopContents(contents, dbupdate.summary1);\n    contents = loopContents(contents, dbupdate.summary2);\n    contents = loopContents(contents, dbupdate.sqlErrors);\n    contents = loopContents(contents, dbupdate.warnings);\n    contents = contents + hex2bin(dbupdate.info);\n    contents = contents + \'</textarea>\';\n	\n    document.getElementById(\"updateNubuilderMessageDetails\").innerHTML=contents;\n}\n\nfunction loopContents(contents, obj) {\n\n    if (obj instanceof Array) {\n        for (var i = 0; i < obj.length; i++) {\n            contents = contents + obj[i];\n            contents = contents + \'&nbsp;\';\n            contents = contents + \'\\r\';      \n        }\n    }\n    return contents; \n}',NULL,0,0,'2014-07-09 16:21:36','globeadmin','2016-09-07 16:46:42','globeadmin','2016-10-21 13:54:25','globeadmin'),('nufastform','browse','faf','Fast Form','SELECT * \nFROM zzzsys_form\nWHERE zzzsys_form_id NOT LIKE \'nu%\'\nAND sfo_table NOT LIKE \'zzzsys_%\'\nORDER BY sfo_title\n','zzzsys_form','zzzsys_form_id',0,0,'','1','1',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'$s = nuGetJSONSubform(\'fast_form_subform\');\n$j = json_decode($s);\n\nfor($i = 0 ; $i-1 < count($j) ; $i++){                                            //-- loop through JSON\n    \n    if($j[$i]->nuDelete == \'1\' and $j[$i]->nuPrimaryKey != \'\'){\n        nuRemoveFastField($j[$i]->nuPrimaryKey);\n    }    \n}\n\n\n\nfunction nuRemoveFastField($i){\n    \n    $s = \"\n        SELECT * \n        FROM zzzsys_object\n        WHERE zzzsys_object_id = \'$i\'\n    \";\n    \n    $t = nuRunQuery($s);\n    $o = db_fetch_object($t);\n    \n    $s = \"\n        SELECT * \n        FROM zzzsys_form\n        WHERE zzzsys_form_id = \'$o->sob_zzzsys_form_id\'\n    \";\n    \n    $t = nuRunQuery($s);\n    $f = db_fetch_object($t);\n    \n    $s = \"\n        DELETE FROM zzzsys_browse\n        WHERE sbr_zzzsys_form_id = \'$f->zzzsys_form_id\'\n        AND sbr_display = \'$o->sob_all_name\'\n    \";\n\n    nuRunQuery($s);                                                             //-- remove Browse Column\n\n}\n\n',NULL,'',NULL,'$GLOBALS[\'nuObjectOrder\']      = 100;\r\n\r\n\r\n$a  = array();\r\n$t  = nuRunQuery(\"SELECT * FROM zzzsys_form WHERE zzzsys_form_id = \'#RECORD_ID#\'\");\r\n$FO = db_fetch_object($t);\r\n\r\nif($FO->sfo_table == \'\'){                                                        //-- add a new form and table\r\n\r\n    $FO->sfo_table = nuFastFormForm($FO);\r\n\r\n}\r\n\r\n$s = \"\r\n    SELECT * \r\n    FROM zzzsys_object \r\n    WHERE sob_zzzsys_form_id = \'$FO->zzzsys_form_id\'\r\n    ORDER BY sob_all_name DESC, zzzsys_object_id\r\n\";\r\n\r\n$t = nuRunQuery($s);\r\n\r\nwhile($OO = db_fetch_object($t)){\r\n    \r\n    if($OO->sob_all_name == \'\'){\r\n    \r\n        $OO->sob_all_name  = nuGetUniqueName($OO->sob_all_title, $a);\r\n        nuAddFastFormObject($FO, $OO);\r\n        \r\n    }\r\n        \r\n    $a[] = $OO->sob_all_name;\r\n    \r\n    $GLOBALS[\'nuObjectOrder\'] = $GLOBALS[\'nuObjectOrder\'] + 1;\r\n    \r\n}\r\n\r\n$s = \"\r\n    DELETE FROM zzzsys_object\r\n    WHERE IFNULL(sob_all_name,\'\') = \'\' \r\n    AND IFNULL(sob_all_type,\'\') = \'\'\r\n\";\r\n\r\nnuRunQuery($s);\r\n\r\n\r\n\r\n//--------------------------------- Functions-----------------------------------\r\n\r\nfunction nuAddFastFormObject($FO, $OO){                                //-- Add Form Object and Browse Column\r\n\r\n    $bid = nuID();\r\n\r\n    $d   = $FO->sfo_table.\'_id\';\r\n    $ord = $GLOBALS[\'nuObjectOrder\'];\r\n    $tit = nuValidTitle($OO->sob_all_title);\r\n\r\n    $s   = \"\r\n    \r\n        UPDATE zzzsys_object\r\n        SET \r\n        sob_all_name = \'$OO->sob_all_name\',\r\n        sob_all_tab_title = \'Main\',\r\n        sob_all_tab_number = \'10\',\r\n        sob_all_column_number = \'10\',\r\n        sob_all_order_number = \'$ord\',\r\n        sob_all_clone = \'1\',\r\n        sob_all_align = \'l\',\r\n        sob_all_no_blanks = \'0\',\r\n        sob_all_read_only = \'0\',\r\n        sob_all_no_duplicates = \'0\',\r\n        sob_all_left = \'0\',\r\n        sob_all_top = \'0\'\r\n        WHERE zzzsys_object_id = \'$OO->zzzsys_object_id\'\r\n\r\n    \";\r\n\r\n    nuRunQuery($s);                                                             //-- add Object\r\n\r\n    $s   = \"\r\n    \r\n    	INSERT INTO zzzsys_browse\r\n    	(\r\n    	zzzsys_browse_id,\r\n    	sbr_zzzsys_form_id,\r\n    	sbr_title,\r\n    	sbr_display,\r\n    	sbr_sort,\r\n    	sbr_align,\r\n    	sbr_order,\r\n    	sbr_width\r\n    	)\r\n    	VALUES\r\n    	(\r\n    	\'$bid\',\r\n    	\'$FO->zzzsys_form_id\',\r\n    	\'$tit\',\r\n    	\'$OO->sob_all_name\',\r\n    	\'$OO->sob_all_name\',\r\n    	\'l\',\r\n    	\'$ord\',\r\n    	150\r\n    	)\r\n	\r\n    \";\r\n    \r\n    nuRunQuery($s);                                                             //-- add Browse\r\n\r\n    nuUpdateObject($bid, $OO, $FO);\r\n    \r\n}\r\n\r\n\r\n\r\nfunction nuUpdateObject($bid, $OO, $FO){\r\n\r\n    $t = 40;\r\n\r\n    if($OO->sob_all_type == \'Text\'){\r\n    \r\n        $osql = \"sob_all_type = \'text\', sob_all_width = 200\";\r\n        $bsql = \"sbr_align = \'l\'\";\r\n        $asql = \"ADD $OO->sob_all_name VARCHAR(300) NOT NULL\";\r\n        \r\n	}\r\n    if($OO->sob_all_type == \'Date\'){\r\n    \r\n        $osql = \"sob_all_type = \'text\', sob_all_width = 90, sob_text_format = \'6\'\";\r\n        $bsql = \"sbr_align = \'l\', sbr_format = \'6\'\";\r\n        $asql = \"ADD $OO->sob_all_name DATE NOT NULL\";\r\n        \r\n	}\r\n    if($OO->sob_all_type == \'Number\'){\r\n    \r\n        $osql = \"sob_all_type = \'text\', sob_all_width = 80, sob_text_format = \'2\', sob_all_align = \'r\'\";\r\n        $bsql = \"sbr_align = \'r\', sbr_format = \'2\'\";\r\n        $asql = \"ADD $OO->sob_all_name DECIMAL(12,2) NOT NULL\";\r\n        \r\n	}\r\n    if($OO->sob_all_type == \'Auto Number\'){\r\n    \r\n        $auto = \'auto_\' . $OO->zzzsys_object_id . \'_\' . $FO->sfo_table ;\r\n        $osql = \"sob_all_type = \'text\', sob_all_width = 60, sob_all_align = \'r\', sob_all_read_only = \'1\', sob_all_default_value_sql = \'#$auto#\'\";\r\n        $bsql = \"sbr_align = \'r\'\";\r\n        $asql = \"ADD $OO->sob_all_name INT NOT NULL\";\r\n        \r\n        $atab = \"\r\n                CREATE TABLE $auto (\r\n                id int(11) NOT NULL AUTO_INCREMENT,\r\n                extra_field varchar(25) NOT NULL,\r\n                PRIMARY KEY (id),\r\n                KEY extra_field (extra_field)\r\n                )\r\n        \";\r\n        \r\n        nuRunQuery($atab);\r\n        \r\n	}\r\n    if($OO->sob_all_type == \'Password\'){\r\n    \r\n        $osql = \"sob_all_type = \'text\', sob_all_width = 100, sob_text_type = \'password\'\";\r\n        $bsql = \"\";\r\n        $asql = \"ADD $OO->sob_all_name VARCHAR(300) NOT NULL\";\r\n        $s = \"DELETE FROM zzzsys_browse WHERE zzzsys_browse_id = \'$bid\'\";\r\n        nuRunQuery($s);\r\n        \r\n	}\r\n   if($OO->sob_all_type == \'Checkbox\'){\r\n    \r\n        $osql = \"sob_all_type = \'checkbox\', sob_all_width = 10\";\r\n        $bsql = \"sbr_display = \'$OO->sob_all_name\', sbr_sort = \'$OO->sob_all_name\'\";\r\n        $asql = \"ADD $OO->sob_all_name VARCHAR(1) NOT NULL\";\r\n        \r\n	}\r\n    if($OO->sob_all_type == \'Text Area\'){\r\n    \r\n        $osql = \"sob_all_type = \'textarea\', sob_all_height = 200, sob_all_width = 200\";\r\n        $bsql = \"sbr_align = \'l\'\";\r\n        $asql = \"ADD $OO->sob_all_name TEXT NOT NULL\";\r\n        \r\n	}\r\n    if($OO->sob_all_type == \'Drop Down\'){\r\n    \r\n        $osql = \"sob_all_type = \'dropdown\', sob_all_width = 50, sob_dropdown_sql = \'0|No|1|Yes\'\";\r\n        $bsql = \"sbr_display = \'$OO->sob_all_name\', sbr_sort = \'$OO->sob_all_name\'\";\r\n        $asql = \"ADD $OO->sob_all_name VARCHAR(300) NOT NULL\";\r\n        \r\n	}\r\n    if($OO->sob_all_type == \'Listbox\'){\r\n    \r\n        $LBN = \'listbox_\' . $OO->zzzsys_object_id . \'_\' . $OO->sob_all_name;\r\n\r\n        $s    = \"\r\n                CREATE TABLE $LBN (\r\n                id VARCHAR(25) NOT NULL, \r\n                choice VARCHAR(200) NOT NULL, \r\n                PRIMARY KEY (id)\r\n                )\r\n                 ENGINE = MyISAM;\r\n                \";\r\n                \r\n        nuRunQuery($s);\r\n        \r\n    \r\n        $s    = \"\r\n                INSERT INTO $LBN\r\n                (id, choice) \r\n                VALUES \r\n                (\'1\', \'Choice 1\'), (\'2\', \'Choice 2\'), (\'3\', \'Choice 3\');\r\n                \";\r\n                \r\n        nuRunQuery($s);\r\n        \r\n\r\n        $osql = \"sob_all_type = \'listbox\', sob_all_width = 200, sob_all_height = 70, sob_listbox_sql = \'SELECT id, choice FROM $LBN\'\";\r\n        $asql = \"ADD $OO->sob_all_name TEXT NOT NULL\";\r\n        $s = \"DELETE FROM zzzsys_browse WHERE zzzsys_browse_id = \'$bid\'\";\r\n        nuRunQuery($s);\r\n        \r\n	}\r\n    if($OO->sob_all_type == \'Word\'){\r\n    \r\n        $osql = \"sob_all_type = \'words\', sob_all_width = 200\";\r\n        $bsql = \"\";\r\n        $asql = \"\";\r\n        $s = \"DELETE FROM zzzsys_browse WHERE zzzsys_browse_id = \'$bid\'\";\r\n        nuRunQuery($s);\r\n        \r\n	}\r\n    if($OO->sob_all_type == \'Display\'){\r\n    \r\n        $osql = \"sob_all_type = \'display\', sob_all_width = 200, sob_display_sql = \'SELECT CURDATE()\'\";\r\n        $bsql = \"\";\r\n        $asql = \"\";\r\n        $s = \"DELETE FROM zzzsys_browse WHERE zzzsys_browse_id = \'$bid\'\";\r\n        nuRunQuery($s);\r\n        \r\n	}\r\n    if($OO->sob_all_type == \'HTML\'){\r\n    \r\n        $osql = \"sob_all_type = \'html\', sob_all_width = 200, sob_all_height = 200, sob_html_code = \'<div style=\\\"background-color:lightblue;height:200px;width:200px\\\">Hello World</div>\'\";\r\n        $bsql = \"\";\r\n        $asql = \"\";\r\n        $s = \"DELETE FROM zzzsys_browse WHERE zzzsys_browse_id = \'$bid\'\";\r\n        nuRunQuery($s);\r\n        \r\n	}\r\n    if($OO->sob_all_type == \'Hidden Field\'){\r\n    \r\n        $osql = \"sob_all_type = \'text\', sob_all_display_condition = \'SELECT 0\'\";\r\n        $bsql = \"\";\r\n        $asql = \"ADD $OO->sob_all_name VARCHAR(300) NOT NULL\";\r\n        $s = \"DELETE FROM zzzsys_browse WHERE zzzsys_browse_id = \'$bid\'\";\r\n        nuRunQuery($s);\r\n        \r\n	}\r\n    if($OO->sob_all_type == \'Javascript Button\'){\r\n    \r\n        $osql = \"sob_all_type = \'button\', sob_all_height = 30, sob_all_width = 200\";\r\n        $bsql = \"\";\r\n        $asql = \"\";\r\n        $s = \"DELETE FROM zzzsys_browse WHERE zzzsys_browse_id = \'$bid\'\";\r\n        nuRunQuery($s);\r\n\r\n        $eid = nuID();\r\n        $s = \"INSERT INTO zzzsys_event (zzzsys_event_id, sev_zzzsys_object_id, sev_name, sev_javascript) VALUES (\'$eid\',\'$OO->zzzsys_object_id\',\'onclick\',\'alert(123);\')\";\r\n        nuRunQuery($s);\r\n        \r\n	}\r\n    if($OO->sob_all_type == \'Open Form Button\'){\r\n    \r\n        $osql = \"sob_all_type = \'button\', sob_all_height = 30, sob_all_width = 200, sob_button_zzzsys_form_id = \'nudebug\'\";\r\n        $bsql = \"\";\r\n        $asql = \"\";\r\n        $s = \"DELETE FROM zzzsys_browse WHERE zzzsys_browse_id = \'$bid\'\";\r\n        nuRunQuery($s);\r\n\r\n	}\r\n\r\n    if($osql != \'\'){\r\n        \r\n        $s = \"UPDATE zzzsys_object SET $osql WHERE zzzsys_object_id = \'$OO->zzzsys_object_id\' \";\r\n        nuRunQuery($s);\r\n\r\n    }\r\n    \r\n    if($bsql != \'\'){\r\n        \r\n        $s = \"UPDATE zzzsys_browse SET $bsql WHERE zzzsys_browse_id = \'$bid\'\";\r\n        nuRunQuery($s);\r\n\r\n    }    \r\n    \r\n    if($asql != \'\'){\r\n        \r\n        $s = \"ALTER TABLE $FO->sfo_table $asql\";\r\n        nuRunQuery($s);\r\n\r\n    }    \r\n}\r\n\r\n\r\nfunction nuFastFormForm($FO){\r\n\r\n    $t   = nuRunQuery(\"SELECT COUNT(*) FROM zzzsys_form\");\r\n    $r   = db_fetch_row($t);\r\n    $n   = $r[0];\r\n    $tn  = nuGetTableName();\r\n    $p   = $tn . \'_id\';\r\n    $b   = nuID();\r\n    $a   = nuID();\r\n\r\n    $s   = \"\r\n    \r\n        UPDATE zzzsys_form\r\n        SET\r\n        sfo_name = \'FF$n\', \r\n        sfo_sql = \'SELECT * FROM $tn\', \r\n        sfo_table = \'$tn\', \r\n        sfo_primary_key = \'$p\', \r\n        sfo_add_button = \'1\', \r\n        sfo_save_button = \'1\', \r\n        sfo_delete_button = \'1\', \r\n        sfo_clone_button = \'1\', \r\n        sfo_print_button = \'1\'\r\n        WHERE zzzsys_form_id = \'$FO->zzzsys_form_id\'\r\n        \r\n    \";\r\n\r\n    nuRunQuery($s);                                                                             //-- create new form\r\n\r\n    $s   = \"\r\n    \r\n        INSERT INTO zzzsys_object\r\n        (\r\n        zzzsys_object_id, \r\n        sob_zzzsys_form_id,\r\n        sob_all_name,\r\n        sob_all_type,\r\n        sob_all_title,\r\n        sob_all_tab_title,\r\n        sob_all_tab_number,\r\n        sob_all_column_number,\r\n        sob_all_order_number,\r\n        sob_all_clone,\r\n        sob_all_align,\r\n        sob_all_no_blanks,\r\n        sob_all_read_only,\r\n        sob_all_no_duplicates,\r\n        sob_all_width,\r\n        sob_all_height,\r\n        sob_button_zzzsys_form_id\r\n        ) \r\n        VALUES \r\n        (\r\n        \'$b\', \r\n        \'nuhome\', \r\n        \'btn$tn\', \r\n        \'button\',\r\n        \'$FO->sfo_title\',\r\n        \'Home\',\r\n        \'10\',\r\n        \'10\',\r\n        \'10\',\r\n        \'1\',\r\n        \'l\',\r\n        \'0\',\r\n        \'0\',\r\n        \'0\',\r\n        \'200\',\r\n        \'30\',\r\n        \'$FO->zzzsys_form_id\'\r\n        )\r\n\r\n    \";\r\n\r\n    nuRunQuery($s);                                                             //-- add Form to Fast Form Access Level\r\n\r\n    $s   = \"\r\n\r\n        INSERT INTO zzzsys_access_level_form \r\n        (\r\n        zzzsys_access_level_form_id, \r\n        slf_zzzsys_access_level_id, \r\n        slf_zzzsys_form_id \r\n        ) \r\n        VALUES\r\n        (\r\n        \'$a\', \r\n        \'nufastformlevel\', \r\n        \'$FO->zzzsys_form_id\'\r\n        );\r\n\r\n    \";\r\n\r\n    nuRunQuery($s);                                                             //-- add Button to Home\r\n    \r\n    \r\n    $s = \"CREATE TABLE $tn ($p VARCHAR(25) NOT NULL, PRIMARY KEY ($p)) ENGINE = MyISAM\";\r\n\r\n    nuRunQuery($s); //-- create new table\r\n\r\n    return $tn;        \r\n    \r\n}\r\n\r\nfunction nuGetTableName(){\r\n\r\n    $n = \'#sfo_title#\';\r\n    \r\n    $s = \"\r\n    \r\n	SELECT TABLE_NAME\r\n	FROM INFORMATION_SCHEMA.TABLES\r\n	WHERE TABLE_SCHEMA = \'$db\'\r\n	GROUP BY TABLE_NAME\r\n    \r\n    \";\r\n    \r\n    $t = nuRunQuery($s);\r\n    $a = array();\r\n    \r\n    while($r = db_fetch_row($t)){\r\n        $a[] = $r[0];\r\n    }\r\n\r\n    return nuGetUniqueName($n, $a);\r\n\r\n}\r\n\r\nfunction nuValidName($n){\r\n    \r\n    $v = preg_replace(\"/[^0-9a-zA-Z _]/\", \"\", $n);\r\n    \r\n    return str_replace(\' \', \'_\', strtolower($v));\r\n}\r\n\r\n\r\nfunction nuValidTitle($n){\r\n    \r\n    return trim(preg_replace(\"/[^0-9a-zA-Z _]/\", \"\", $n));\r\n    \r\n}\r\n\r\n\r\nfunction nuGetUniqueName($name, $a){\r\n\r\n    $n = nuValidName($name);\r\n    \r\n    $c = \'\';\r\n    \r\n    while(true){\r\n\r\n\r\n        if(array_search($n . $c, $a) == \'\'){\r\n            return $n . $c;\r\n        }else{\r\n  \r\n            if($c == \'\'){\r\n                $c = 1;\r\n            }else{\r\n                $c = $c + 1;\r\n            }\r\n\r\n       }\r\n       \r\n    }\r\n\r\n}\r\n\r\n',NULL,'function nuFastFormObject(t){\n    \n    var r = $(\'#\' + t.id).attr(\'data-prefix\');\n    var p = $(\'#\' + r + \'_nuPrimaryKey\').val();\n    \n    if(p == \'\'){\n        alert(\'This Fast Form must be saved first.\')\n    }else{\n        nuOpenFormInFrame(\'nuobject\', p);\n    }\n    \n}\n\nfunction nuFastFormFormView(){\n    \n    var p = \'#RECORD_ID#\';\n    \n    if(p == \'-1\'){\n        alert(\'This Fast Form must be saved first.\')\n    }else{\n        nuOpenFormInFrame(p, \'-1\');\n    }\n    \n}\n\n\nfunction nuFastFormBrowseView(){\n    \n    var p = \'#RECORD_ID#\';\n    \n    if(p == \'-1\'){\n        alert(\'This Fast Form must be saved first.\')\n    }else{\n        nuOpenBrowseInFrame(p);\n    }\n    \n}\n\nfunction nuFastFormForm(){\n    \n    var p = \'#RECORD_ID#\';\n    \n    if(p == \'-1\'){\n        alert(\'This Fast Form must be saved first.\')\n    }else{\n        nuOpenFormInFrame(\'nuform\', p);\n    }\n    \n}\n\nfunction nuLoadEdit(){ \n\n    nuPopulateFFSubform();\n    $(\'#ff_talk\').html(nuTranslate(\'\"Add an Object to this Form\"\'));\n\n    \n}\n\nfunction nuHideLastSFRow(){ \n\n\n    var s = nuSubformArray(\'fast_form_subform\', true);\n\n    $(\'#\' + s[s.length-1] + \'_nuRow\').css(\'visibility\', \'hidden\');\n    $(\'#\' + s[s.length-1] + \'_nuDelete\').prop(\'checked\', true)\n\n}\n\n\nfunction nuAddFFObject(pthis){\n\n    var s = nuSubformArray(\'fast_form_subform\', true);\n    var r = s[s.length-1];\n\n    $(\"[id$=\'fast_form_object_properties\']\").val(\'P\');\n    $(\'#\' + r + \'_nuRow\').css(\'visibility\', \'visible\');\n    $(\'#\' + r + \'fast_form_object_description\').html(\'&nbsp;\' + pthis.value + \' (\'+ $(\'#\'+pthis.id).attr(\'data-type\') + \')\');\n    $(\'#\' + r + \'sob_all_type\').val($(\'#\'+pthis.id).val());\n    $(\'#\' + r + \'sob_all_title\').val(pthis.value + \' \' + s.length);\n    $(\'#\' + r + \'sob_all_title\').focus();\n\n    nuAddRow(\'fast_form_subform\');\n\n    nuHideLastSFRow();\n\n    var o = String(pthis.value).toLowerCase().replaceAll(\' \', \'_\', true);\n    \n}\n\n\nfunction nuPopulateFFSubform(){\n\n    var i = 0;\n    var r = \'\';\n    var s = nuSubformArray(\'fast_form_subform\', true);\n    \n    for(i = 0 ; i < s.length ; i++){\n        \n        $(\'#\' + s[i] + \'_nuRow\').css(\'visibility\', \'visible\');\n        $(\'#\' + s[i] + \'_nuDelete\').prop(\'checked\', false)\n        $(\'#\' + s[i] + \'fast_form_object_description\').html(\'&nbsp;\' + String($(\'#\' + s[i] + \'sob_all_type\').val()).toUpperCase());\n    }\n\n    $(\"[id$=\'fast_form_object_properties\']\").val(\'P\');\n    $(\"[id$=\'fast_form_object_properties\']\").attr(\'title\',\'Edit Properties\');\n    $(\"#fast_form_properties\").attr(\'title\',\'Edit Properties\');\n    $(\"#fast_form_form_view\").attr(\'title\',\'View Edit Form\');\n    $(\"#fast_form_browse_view\").attr(\'title\',\'View Browse Form\');\n\n    nuHideLastSFRow();\n    \n}\n',NULL,0,0,'2015-03-11 12:21:31','globeadmin','2015-04-15 12:04:02','globeadmin','2015-04-15 12:04:02','globeadmin'),('58180302305a41e','','dropzone','Dropzone Example','SELECT * FROM zzzsys_setup','zzzsys_setup','zzzsys_setup_id',900,500,'',NULL,'1',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'',NULL,'// Check if a table was created\n$table_name = \'#dropzonetable#\';\n$sql        = \"SHOW TABLES LIKE \'$table_name\' \"; \n$rs         = nuRunQuery($sql);\n$rows   =  db_num_rows($rs);\n\n// If table exist, loop thru it and get the file information and blob to use wherever you want.\n// In this example will insert a new record in the default zzzsys_file table\nif ( $rows == \'1\' ) {\n\n    $dt             = new DateTime();\n    $date           = $dt->format(\'Y-m-d H:i:s\');\n    \n    $sql            = \"SELECT * FROM $table_name\";\n    $rs             = nuRunQuery($sql);\n  \n    while ( $obj = db_fetch_object($rs) ) {\n        $dz_id          = $obj->dz_id; \n        $id             = nuID();\n        $code           = substr(str_shuffle(MD5(microtime())), 0, 10);\n        $desc           = $obj->dz_message;\n        $dz_type        = $obj->dz_type;\n        $dz_size        = $obj->dz_size;\n        $dz_width       = $obj->dz_width;\n        $dz_height      = $obj->dz_height;\n        $dz_name        = $obj->dz_name;\n        \n        $sql            = \"\n        INSERT INTO zzzsys_file (zzzsys_file_id, sfi_code, sfi_group, sfi_description, sfi_type, sfi_size, sfi_width, sfi_height, sfi_name, sfi_blob, zzzsys_file_log_changed_at) \n        VALUES (\'$id\', \'$code\', \'dropzone\', \'$desc\', \'$dz_type\', \'$dz_size\', \'$dz_width\', \'$dz_height\', \'$dz_name\', (SELECT $table_name.dz_blob FROM $table_name WHERE $table_name.dz_id = \'$dz_id\'), \'$date\')\";\n        nuRunQuery($sql);\n    }\n\n    nuRunQuery(\"DROP TABLE IF EXISTS $table_name \");\n}\n\n',NULL,'function dropzoneButton(acp) {\n\n    var url = \'\';\n    if(arguments.length == 1) {\n        url = \'dropzone.php?ses=#session_id#&usr=#nu_user_id#&tbl=#TABLE_ID#&acp=\' + acp;\n    } else {\n        url = \'dropzone.php?ses=#session_id#&usr=#nu_user_id#&tbl=#TABLE_ID#\';\n    }\n\n    var iframe_id = \'dropzone\';\n    var sW = \'600px\';\n    var sH = \'200px\';\n    var sT = \'260px\';\n    var sL = \'260px\';\n    var e  = null;\n    \n	e = document.createElement(\'div\');\n    e.setAttribute(\'id\', \'nuModal\');\n    $(\'body\').append(e);\n    $(\'#\' + e.id).css({\n    	\'width\'            : \'100%\',\n        \'height\'           : \'100%\',\n        \'top\'              : \'0px\',\n        \'left\'             : \'0px\',\n        \'position\'         : \'fixed\',                   \n        \'background-color\' : \'#000000\',\n        \'filter\'           : \'Alpha(Opacity=20)\',\n        \'opacity\'          : \'.2\'\n    });\n\n    e = document.createElement(\'div\');              //-- create draggable div\n    e.setAttribute(\'id\', \'nuDrag\');\n    $(\'body\').append(e);\n    $(\'#\' + e.id).css({\n    	\'width\'            : sW,\n        \'height\'           : sH,\n        \'top\'              : sT,\n        \'left\'             : sL,\n        \'position\'         : \'absolute\',\n        \'background-color\' : \'#E1E8EA\',\n        \'border-width\'     : \'0px\',\n        \'border-color\'     : \'#01A6F5\',\n        \'border-style\'     : \'solid\',\n        \'filter\'           : \'Alpha(Opacity=100)\',\n        \'opacity\'          : \'1\'\n    })\n    .draggable({ handle: \'nuDragBar\' });\n        \n    var screenSection = \'nuDrag\';\n    e = document.createElement(\'div\');              //-- create draggable div\n    e.setAttribute(\'id\', \'nuDragBar\');\n    $(\'#\'+ screenSection).append(e);\n    $(\'#\' + e.id).css({\n        \'width\'            : \'20px\',\n        \'height\'           : \'22px\',\n        \'top\'              : \'0px\',\n        \'left\'             : \'0px\',\n        \'position\'         : \'absolute\',\n        \'background-color\' : \'#B6B6B6\',\n        \'z-index\'          : \'1\'\n    });\n\n    e = document.createElement(\'div\');              //-- create draggable div\n    e.setAttribute(\'id\', \'nuDragBarClose_\');\n    $(\'#nuDragBar\').append(e);\n    $(\'#\' + e.id).css({\n        \'width\'            : \'20px\',\n        \'height\'           : \'20px\',\n        \'top\'              : \'1px\',\n        \'left\'             : \'0px\',\n        \'position\'         : \'absolute\',\n        \'background-color\' : \'#E1E8EA\',\n        \'z-index\'          : \'2\'\n    	})\n        .addClass(\'nuClose\')\n        .html(\'&#10006;\')\n        .mousedown(function() {\n            $(\'#nuModal\').remove();\n            $(\'#nuDrag\').remove();\n    });\n\n    e = document.createElement(\'iframe\');              //-- create iframe\n    e.setAttribute(\'name\', iframe_id);\n    e.setAttribute(\'id\', iframe_id);\n    e.setAttribute(\'src\', url);\n    $(\'#\'+ screenSection).append(e);\n    $(\'#\' + iframe_id).css({\n        \'border-radius\' : \'5px\',\n        \'width\'         : \'100%\',\n        \'height\'        : \'100%\',\n        \'top\'           : \'20px\',\n        \'left\'          : \'0px\',\n        \'position\'      : \'absolute\'\n    });\n}',NULL,0,0,'2016-11-01 13:20:42','globeadmin','2016-11-02 10:25:22','globeadmin','2017-03-21 12:28:55','globeadmin'),('nurunphp','browse','rph','Run Procedure','SELECT * FROM zzzsys_php\r\nINNER JOIN zzzsys_form ON slp_zzzsys_form_id = zzzsys_form_id\r\nLEFT JOIN zzzsys_access_level_php ON slp_zzzsys_php_id = zzzsys_php_id\r\nLEFT JOIN zzzsys_access_level ON slp_zzzsys_access_level_id = z