lute;left:350px;top:200px;width:50px\"/>\';\n\n    \n    $j = \"\n\n	var e = document.createElement(\'div\');\n	\n	e.setAttribute(\'id\', \'nuSplash\');\n	\n	$(\'#nu_tab_area0\').append(e);\n	\n	$(\'#nuSplash\').css({\n		\'width\'            : 450,\n		\'height\'           : 250,\n		\'top\'              : -10,\n		\'left\'             : 250,\n		\'position\'         : \'absolute\',\n		\'background-color\' : \'white\',\n		\'color\'            : \'black\',\n		\'z-index\'          : 5000,\n		\'border-width\'     : \'1px\',\n		\'border-color\'     : \'black\',\n		\'border-style\'     : \'solid\',\n		\'filter\'           : \'Alpha(Opacity=100)\',\n		\'opacity\'          : \'1\',\n		\'box-shadow\'       : \'5px 5px 5px #888888\'\n	})\n\n	$(\'#nuSplash\').html(\'$h\');\n\n    \n    \";\n\n    nuAddJavascript($j);\n    \n}\n\n','nuRunQuery(\"UPDATE zzzsys_setup SET set_splash = \'1\'\");','','function nuLoadEdit() { \n    \n    $(\'#homeform\').css(\'background-color\',\'#7CC342\');\n    \n    $(\'#fafbtn\').attr(\'title\',\"Create a Form and it\'s Table with no programming\");\n\n}\n\nfunction nuCloseSplash(){\n    \n    var s = $(\'#nuCheckClose\').is(\':checked\');\n    \n    $(\'#nuSplash\').remove();\n\n    if(s){\n        nuSaveForm();        \n    }\n\n}','',0,0,'0000-00-00 00:00:00','','2015-04-20 10:12:37','globeadmin','2015-04-20 10:12:37','globeadmin'),('nurunreport','browse','rre','Run Report','SELECT * FROM zzzsys_report\r\nINNER JOIN zzzsys_form ON sre_zzzsys_form_id = zzzsys_form_id\r\nLEFT JOIN zzzsys_access_level_report ON slr_zzzsys_report_id = zzzsys_report_id\r\nLEFT JOIN zzzsys_access_level ON slr_zzzsys_access_level_id = zzzsys_access_level_id\r\nWHERE (sal_code = \'#nu_access_level#\' OR \'#nu_access_level#\' = \'globeadmin\')\r\nGROUP BY zzzsys_report_id \r\nORDER BY sre_code','zzzsys_report','zzzsys_report_id',900,0,'','0','0','1','1','','','','','','','','','','','','','','','','','','','','','','',0,0,'0000-00-00 00:00:00','','2014-09-22 10:35:18','globeadmin','2014-09-24 12:40:23','globeadmin'),('nuphp','browse','aph','PHP Code','SELECT * FROM  zzzsys_php ORDER BY slp_code','zzzsys_php','zzzsys_php_id',1000,0,'','1','1','1','1','','','','','','','','','SELECT IF(\'#slp_group#\' = \'nubuilder\',\'0\',\'1\');','SELECT IF(\'#slp_group#\' = \'nubuilder\',\'0\',\'1\');','SELECT IF(\'#slp_group#\' = \'nubuilder\',\'0\',\'1\');','SELECT IF(\'#slp_group#\' = \'nubuilder\',\'0\',\'1\');','','','','','','','','','  \r\n    $(document).ready(function() {\r\n\r\n\r\n        $(\"#slp_php\").css(\'background-color\', \'#FFE8CA\');\r\n        $(\"#slp_php\").css(\'font-family\', \'Courier New\');\r\n        $(\"#slp_php\").css(\'font-size\', \'14px\');\r\n        $(\"#slp_php\").attr( \'wrap\', \'off\');\r\n\r\n    });\r\n\r\n','',0,0,'0000-00-00 00:00:00','','2013-10-16 15:15:33','globeadmin','2013-11-08 11:19:17','globeadmin'),('nuformwizard','browse','FW','Form Wizard','select * from zzzsys_debug','zzzsys_debug','zzzsys_debug_id',1300,600,'SELECT \'CREATE FORM\'','','1','','','','','','Create Form','','','','','','','','','','','function getProperties($attr) {\r\n    $type               = \'text\';\r\n    $height             = \'\';\r\n    $width              = $attr[3];\r\n    $title              = $attr[4];\r\n    $lookup             = $attr[5];\r\n    $lookup_code        = $attr[6];\r\n    $lookup_description = $attr[7];\r\n    $align              = \'l\';\r\n    $format             = \'\';\r\n    \r\n    switch ($attr[1]) {\r\n        case \'date\':\r\n            $format = \'6\';\r\n            break;\r\n        case \'int\':\r\n            $align  = \'r\';\r\n            $format = \'0\';\r\n            break;\r\n        case \'double\':\r\n            $align = \'r\';\r\n            if($attr[2] <= 5) {\r\n                $format = $attr[2];\r\n            }\r\n            else {\r\n                $format = \'5\';\r\n            }\r\n            break;\r\n        case \'decimal\':\r\n            $align = \'r\';\r\n            if($attr[2] <= 5) {\r\n                $format = $attr[2];\r\n            }\r\n            else {\r\n                $format = \'5\';\r\n            }\r\n            break;\r\n        case \'text\':\r\n            $type   = \'textarea\';\r\n            $height = \'150\';\r\n            $width  = \'250\';\r\n            break;\r\n    } \r\n    if( $lookup !== \'\' ) {\r\n        $type = \'lookup\';\r\n    }\r\n      \r\n    $values = array(\r\n        \"align\"              => $align,\r\n        \"format\"             => $format,\r\n        \"width\"              => $width,\r\n        \"title\"              => $title,\r\n        \"height\"             => $height,\r\n        \"type\"               => $type,\r\n        \"lookup\"             => $lookup,\r\n        \"lookup_code\"        => $lookup_code,\r\n        \"lookup_description\" => $lookup_description\r\n    );\r\n    return $values;\r\n}\r\n\r\n\r\n$form    = nuID();\r\n$sql     = \"SELECT * FROM #fw_table_name#\";\r\n$table   = \'#fw_table_name#\';\r\n$primary = \'#fw_hidden_primary#\';\r\n$columns = array();\r\n$browse  = \'#fw_browse_listbox#\';\r\n$fields  = \'#fw_form_listbox#\';\r\n\r\nif( $table === \'\') {\r\n    nuDisplayError(\'A table needs to be chosen.\');\r\n    return;\r\n}\r\n\r\nif( $primary === \'\') {\r\n    nuDisplayError(\"Form Wizard can\'t detect Primary Key on selected table.\");\r\n    return;\r\n}\r\n\r\nif( $browse === \'\' && $fields === \'\' ) {\r\n    nuDisplayError(\'No fields chosen to display\');\r\n    return;\r\n}\r\n\r\n$s = \"\r\n    INSERT INTO zzzsys_form (zzzsys_form_id, sfo_name, sfo_sql, sfo_table, sfo_primary_key, sfo_title,sfo_add_button, sfo_save_button, sfo_delete_button)\r\n    VALUES (\'$form\',\'$table\',\'$sql\',\'$table\',\'$primary\', \'$table\', \'1\', \'1\', \'1\');\r\n\";\r\n\r\nnuRunQuery($s);\r\n    \r\nif($browse !== \'\' ) {\r\n    $browse = explode(\'#nuSep#\',$browse );\r\n    foreach( $browse as $value ) {\r\n        $columns[] = explode(\