INSERT INTO `zzzsys_setup` VALUES ('1','NOT USED DELETED THIS FIELD',120,'Australia/Adelaide','','','','','',0,'','','','<script>\nfunction nuLoadEditGlobal(){\n	nuOnLoad();\n}\nfunction nuLoadBrowseGlobal(){\n	nuOnLoad();\n}\nfunction nuOnLoad() {\n    /*                 \n    if (window.top === window.self) {\n    } else {\n           if ( !window.parent.document.getElementById(\'nuDrag\') ) {\n               document.body.style.backgroundColor = \'#EDEDED\';\n           }      \n    }\n    */\n}\n</script>\n\n\n\n<style>\nb                            {color: #666666;}\na:focus, \na:visited, \na:hover, \na:active                     {outline: thin dotted #333;outline: 5px auto -webkit-focus-ring-color;outline-offset: -2px;color: #666666;}\ntable                        {padding:0px;margin:0px;text-align:center;vertical-align:top;margin-left:auto;margin-right:auto;width:100%;cellspacing:0px;cellpadding:0px}\ntr                           {padding:0px;margin:0px;text-align:top;vertical-align:top;}\ntd                           {padding:0px;margin:0px}\ndiv                          {padding:0px;margin:0px}\nimg                          {padding:0px;margin:0px;}\nselect                       {padding:0px;margin:0px; font-family:\"Helvetica Neue\", Helvetica, Arial, sans-serif;}\ntextarea                     {padding:0px;margin:0px;font-family:\"Helvetica Neue\", Helvetica, Arial, sans-serif;}\niframe                       {border: 0px;margin: 0px;padding: 0px;}\nbody                         {margin: 0;font-family: \"Helvetica Neue\", Helvetica, Arial, sans-serif;font-size: 13px;line-height: 18px;color: #202020;background-color: ##f4f4f4;}\n.ui-widget                   {font-size: 0.8em;}\n.ui-autocomplete             {max-height: 200px; overflow-y: auto; overflow-x: hidden; }\ninput {\n	padding:0px;\n	margin:0px; \n	font-family:\"Helvetica Neue\", Helvetica, Arial, sans-serif;\n	border: 1px solid #e1e8ea;\n  	outline: none;\n	box-shadow: none;\n	padding: 0px;\n}\nselect