;font-size:16px;font-family:\"Helvetica Neue\", Helvetica, Arial, sans-serif;background-color:white}\n.nuShadeHolder               {border-bottom-left-radius:0px;border-bottom-right-radius:0px;border-top-right-radius:0px;border-top-left-radius:0px;box-shadow: 0px 0px 0px #888888;position:absolute;top:70px;left:0px;margin:auto;width:1002px;height:542px}\n.nuDialogHolder              {position:absolute;left:0px;width:1020px;height:700px;border-style:solid;border-width:0px 0px 0px 0px;border-color:grey;-moz-border-radius: 0px;border-radius: 0px;}\n.nuActionButtonHolder        {position:absolute;top:15px;left:0px;width:1100px;text-align:center}\n.nuTabAreaHolder             {position:absolute;top:23px;left:0px;}\n.nuBrowseTabAreaHolder       {position:absolute;top:60px;left:0px;}\n.nuBrowseSearch              {color:red}\n.nuBreadCrumbHolder {\n	position:absolute;\n	left:0px;\n	top:45px;\n	font-family:\"Helvetica Neue\", Helvetica, Arial, sans-serif;\n	color:#f7961c;\n	*zoom: 1;\n	margin-bottom: 0;\n	font-size: 15px;\n	line-height: 18px;\n	vertical-align: middle \n}\n.nuBreadCrumbSection {\n	font-family:\"Helvetica Neue\", Helvetica, Arial, sans-serif;\n	*zoom: 1;\n	margin-bottom: 2px;\n	font-size: 15px;\n	line-height: 23px;\n	text-decoration: underline;\n	vertical-align: middle; \n	cursor: pointer;\n}\n.nuBreadCrumbPointer {\n	color: #F7961C;\n	font-family:\"Helvetica Neue\", Helvetica, Arial, sans-serif;\n	*zoom: 1;\n	margin-bottom: 2px;\n	font-size: 15px;\n    line-height: 23px;\n    vertical-align: middle; \n}\n.nuBreadCrumbSectionEnd {\n    font-family:\"Helvetica Neue\", Helvetica, Arial, sans-serif;\n    color: #F7961C;\n    *zoom: 1;\n    margin-bottom: 2px;\n    font-size: 15px;\n    line-height: 23px;\n    vertical-align: middle; \n}\n.nuTabTitleHolder {\n	font-family:\"Helvetica Neue\", Helvetica, Arial, sans-serif;\n	font-size:16px;\n	position:absolute;\n	left:0px;\n	top:0px;\n	width:1100px;\n	min-height:18px;\n	-moz-border-top-left-radius:0px;\n	-moz-border